    "longAnswer" : "<span style=\"color:#000000;\">The problem &quot;Feathers and Fur&quot; was a bit confusing, and still is but i&#39;m going to try my best to solve the problem.. So Xiao has 36 heads and 80 feet, all together she has 36 dogs and pigeons.</span> Dogs have 4 legs, pigeons have 2, at first i tried to solve the problem but i forgot about the pigeons, that they only have 2 legs, so that very important to remember. I&#39;m going to try examples...<br /> 2 * 32 = 64 Pigeons &nbsp; &nbsp;4 * 4 = 16 Dogs. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 64 + 16 = 80 Feet. I guest the number 32, at first i tried 32 dogs but it was not the right number, then i added 4 because we needed to get to 36, then i multiplied pigeon feet by 32 and multiplied dog feet by 4 and got 64 and 16 then i added them and got 80.",
