    "longAnswer" : "<strong><span style=\"color: rgb(0, 0, 255);\">I notice that they are asking me to find the amount of animals their are for pigeons and dogs.&nbsp;</span></strong><strong><span style=\"color:#FF0000;\">looking at my&nbsp;</span></strong><strong><span style=\"color:#FF0000;\">answer it&nbsp;</span></strong><strong><span style=\"color:#FF0000;\">seems reasonable because it works out with&nbsp;the asked problem.</span><span style=\"color:#0000FF;\"> i thought the problem was hard until i tried different numbers until i got the answer.</span><span style=\"color:#FF0000;\"> In the problem i got stuck when the problem asked how many there are for dogs and pigeons. &nbsp;</span></strong>\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 500px;\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><strong><span style=\"color:#0000ff;\"># of pigeons&nbsp;</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\"># of dogs</span>&nbsp;</strong></td>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">#of pigeons legs</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">#of dog legs</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">total</span></strong></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">24</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">12</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">48</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">24</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">72</span></strong></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">30</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">6</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">60</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">12</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">72</span></strong></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">35</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">1</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">70</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">4</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#ff0066;\">74</span></strong></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">32</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">4</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">64</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">16</span></strong></td>\r\n\t\t\t<td><strong><span style=\"color:#0000FF;\">80</span></strong></td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\ncheck: &nbsp;32 &nbsp; &nbsp; &nbsp; &nbsp; 64<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;+4 &nbsp; &nbsp; &nbsp; +16<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 36 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;80",
