    "longAnswer" : "<p><span style=\"font-family: comic sans ms, cursive\">I got the answer by <em>multiplying</em> 32 and 2 wich equals 64, and&nbsp;then <em>multiplying</em> 4 and 4 which equaled 16, and then <em>adding </em>64 and 16 wich then equaled 80 feet.</span></p>\r\n\r\n<p><span style=\"font-family: georgia, serif\"><span style=\"font-family: comic sans ms, cursive\"><span style=\"color: #0000ff\">Check For Answer</span></span><br />\r\n&nbsp;32*2=64&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4*4=16&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 64+16=80&nbsp; &nbsp;80-16=64</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family: comic sans ms, cursive\">&nbsp;I think that this problem was a little hard to find the answer to because it took a lot of number guessing, and a lot of multiplying,adding,and&nbsp;dividing.<br />\r\nIf someone needed a hint&nbsp;on this problem i would tell them to draw a picture out for it.</span></p>\r\n\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 500px\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"font-family: comic sans ms, cursive\"># of pigeons</span></td>\r\n\t\t\t<td><span style=\"font-family: comic sans ms, cursive\"># of dogs</span></td>\r\n\t\t\t<td><span style=\"font-family: comic sans ms, cursive\"># of pigeion legs</span></td>\r\n\t\t\t<td><span style=\"font-family: comic sans ms, cursive\"># of dog legs </span></td>\r\n\t\t\t<td><span style=\"font-family: comic sans ms, cursive\">total</span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">25</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">11</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">50</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">44</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">94</span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">26</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">10</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">52</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">40</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">92</span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">24</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">12</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">48</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">48</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">96</span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">28</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">8</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">56</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">32</span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\">88</span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\"><span style=\"color: #0000cd\">32</span></span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\"><span style=\"color: #0000cd\">4</span></span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\"><span style=\"color: #0000cd\">64</span></span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\"><span style=\"color: #0000cd\">16</span></span></td>\r\n\t\t\t<td><span style=\"font-family: georgia, serif\"><span style=\"color: #0000cd\">80</span></span></td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>",
