    "longAnswer" : "<span style=\"color:#A52A2A;\"><span style=\"font-family:georgia,serif;\"><strong>In the problem &quot;Feathers and fur&quot; Xiao said that she counted<br />\r\nthe heads and the legs, 36 heads and 80 legs and so in made a chart and went down the chart trying to solve the problem of how many dog and pigeons there &#8203;are. So&nbsp;finally i took 32 Pigeons and 4 dogs and then got 64 and then got 16 and then got the 80 legs.</strong></span></span><br />\r\n&nbsp;\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 500px;\">\r\n\t<caption><span style=\"color:#696969;\"><span style=\"font-size:24px;\"><span style=\"font-family:georgia,serif;\">F</span></span></span><span style=\"color:#00FFFF;\"><span style=\"font-size:24px;\"><span style=\"font-family:georgia,serif;\">eathers </span></span></span><span style=\"color:#696969;\"><span style=\"font-size:24px;\"><span style=\"font-family:georgia,serif;\">a</span></span></span><span style=\"color:#00FFFF;\"><span style=\"font-size:24px;\"><span style=\"font-family:georgia,serif;\">nd</span></span></span><span style=\"color:#696969;\"><span style=\"font-size:24px;\"><span style=\"font-family:georgia,serif;\">&nbsp;F</span></span></span><span style=\"color:#00FFFF;\"><span style=\"font-size:24px;\"><span style=\"font-family:georgia,serif;\">ur</span></span></span></caption>\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"font-family:georgia,serif;\"><span style=\"font-size:24px;\"><span style=\"color:#00FFFF;\">:)</span></span></span></td>\r\n\t\t\t<td><span style=\"color:#696969;\"><span style=\"font-family:georgia,serif;\"><span style=\"font-size:24px;\">:)</span></span></span></td>\r\n\t\t\t<td rowspan=\"2\"><span style=\"font-family:georgia,serif;\"><span style=\"font-size:24px;\"><span style=\"color:#00FFFF;\">:)</span></span></span></td>\r\n\t\t\t<td rowspan=\"2\"><span style=\"color:#696969;\"><span style=\"font-family:georgia,serif;\"><span style=\"font-size:24px;\">:)</span></span></span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td colspan=\"2\" rowspan=\"2\"><span style=\"font-size:24px;\"><span style=\"color:#696969;\"><span style=\"font-family:georgia,serif;\">P</span></span><span style=\"color:#00FFFF;\"><span style=\"font-family:georgia,serif;\">igeons</span></span> &nbsp; &nbsp;</span> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color:#696969;\">&nbsp;<span style=\"font-family:comic sans ms,cursive;\"> 19&nbsp;</span></span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\">18</span></span></td>\r\n\t\t\t<td><span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\">32</span></span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td colspan=\"2\"><span style=\"font-size:24px;\"><span style=\"color:#696969;\"><span style=\"font-family:georgia,serif;\">D</span></span><span style=\"color:#00FFFF;\"><span style=\"font-family:georgia,serif;\">ogs &nbsp; &nbsp; </span></span>&nbsp; &nbsp; &nbsp;</span> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\"> &nbsp;17</span></span></td>\r\n\t\t\t<td><span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\">18</span></span></td>\r\n\t\t\t<td><span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\">4</span></span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td colspan=\"2\"><span style=\"font-size:24px;\"><span style=\"font-family:georgia,serif;\"><span style=\"color:#696969;\">P</span><span style=\"color:#00FFFF;\">igeons</span><span style=\"color:#696969;\">&nbsp;L</span><span style=\"color:#00FFFF;\">egs &nbsp;</span></span> </span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\"> 38</span></span></td>\r\n\t\t\t<td><span style=\"font-family:comic sans ms,cursive;\"><span style=\"color:#696969;\">36</span></span></td>\r\n\t\t\t<td><span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\">64</span></span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td colspan=\"2\"><span style=\"font-size:24px;\"><span style=\"color:#696969;\"><span style=\"font-family:georgia,serif;\">D</span></span><span style=\"color:#00FFFF;\"><span style=\"font-family:georgia,serif;\">ogs </span></span><span style=\"color:#696969;\"><span style=\"font-family:georgia,serif;\">L</span></span><span style=\"color:#00FFFF;\"><span style=\"font-family:georgia,serif;\">egs &nbsp; &nbsp; </span></span>&nbsp; </span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\"> 68</span></span></td>\r\n\t\t\t<td><span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\">72</span></span></td>\r\n\t\t\t<td><span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\">16</span></span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td colspan=\"2\"><span style=\"font-size:24px;\"><span style=\"color:#696969;\"><span style=\"font-family:georgia,serif;\">A</span></span><span style=\"color:#00FFFF;\"><span style=\"font-family:georgia,serif;\">ll </span></span><span style=\"color:#696969;\"><span style=\"font-family:georgia,serif;\">L</span></span><span style=\"color:#00FFFF;\"><span style=\"font-family:georgia,serif;\">egs &nbsp; &nbsp;</span></span> &nbsp;</span> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"font-family:comic sans ms,cursive;\"><span style=\"color:#696969;\">106&nbsp;</span></span></td>\r\n\t\t\t<td><span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\">108 &nbsp; </span></span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n\t\t\t<td><span style=\"color:#696969;\"><span style=\"font-family:comic sans ms,cursive;\">80 &nbsp; </span></span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n<br />\r\n<span style=\"color:#A52A2A;\"><span style=\"font-family:georgia,serif;\"><strong>My refletion is that when i started i wanted to give up so much that i was just playing around with number that i got 32 and 4 and then i said how about 32 pigeons and 4 dogs and then i started to mulitpy and then i did this.... 32*2=64 and 4*4=16 and 64+16=80 so i got my 80 legs and my heads by 32+4=36 so i got my 36 heads and my 80 legs.<br />\r\n&nbsp;<br />\r\nMy reflection is that i would alway ask how do you get 80 legs out of 36 head and now that i solved it now i know that you can get 80 legs out of 36 heads.<br />\r\n<br />\r\nMy relfection&#39;s is that when i got so close it seemed that i got farther away from the answer and now i don&#39;t have that problem because i solved the problem&nbsp;<br />\r\n&nbsp;</strong></span></span><br />\r\n<br />\r\n&nbsp;",
