    "longAnswer" : "<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 500px\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"color: #00ff00\"># of pigeons</span></td>\r\n\t\t\t<td><span style=\"color: #00ff00\">#of pigeon legs</span></td>\r\n\t\t\t<td><span style=\"color: #00ff00\"># of dogs</span></td>\r\n\t\t\t<td><span style=\"color: #00ff00\"># of dogs legs</span></td>\r\n\t\t\t<td><span style=\"color: #00ff00\">All together</span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"color: #0000ff\">30</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">60</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">6</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">24</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">84</span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"color: #0000ff\">31</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">62</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">5</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">20</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">82</span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"color: #0000ff\">32</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">64</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">4</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">16</span></td>\r\n\t\t\t<td><span style=\"color: #0000ff\">80</span></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td colspan=\"5\">I Got my awnser by timesing and dividing the heads and legs to get my awnser. I Thought trying a table would be an easyer way the other ways. The problem was a kinda hard but yet no really.<br />\r\n\t\t\t<br />\r\n\t\t\tI thought it was easy using adding and subtracting legs.<br />\r\n\t\t\tI thought it was better to use division in my awnser finding as well.<br />\r\n\t\t\tI think it was better when i got the number of animals right.</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>",
