    "powId" : 863805,
    "shortAnswer" : "The whole group discussion of the I notice and I wonder on the chocolate problem and the various ways in which teachers looked at the problem. The idea of reading and reflecting after just one read is an awesome activity. It has made me realize how important it is to not read superficially. This is definitely something I would like to implement with my students. The first activity 'Connections' is a great way of helping me think deeply.  Great concept. i wonder how does one reach to the stage where he/she can think through a problem and see all the different ways in which students can interpret a problem. I find this difficult at times and I really wonder how I can make more time to be more involved in the process. Working with Lois and planning our online collaboration for next term was very productive and I learned some more about the software.",
